import React, { useEffect } from "react";
import MovieList from "../Principal/MovieList";

const Favoritos = ({favoritos, poster_path}) => {
  const [fab, setFab] = ([])
  useEffect(() => {
    setFab(favoritos);
  }, []);
  return (
    <div>
      <p>Funciona</p>
      <MovieList movies={favoritos} onAddFavorite={(e) => {}} />
    {favoritos.map(movies=>{
<img src={`https://image.tmdb.org/t/p/w200/${poster_path}`} alt="" srcset="" />
    })}
    {console.log(favoritos)}
    </div>
  );
};

export default Favoritos;
